import logo from './img/rick-morty.png';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} alt='Rick and Morty'></img>
        <h1 className='title'>Rick and Morty</h1>
      </header>
    </div>
  );
}

export default App;
